from typing import List


class Solution:
    def longestCommonPrefix(self, strs: List[str]) -> str:
        # 公共前缀
        common_prefix = ""

        if len(strs) == 1:
            return strs[0]
        elif len(strs) <= 1:
            return ""
        else:
            # 如果对比的字符中有空字符，就不用对比了
            for s in strs:
                if s == '':
                    return ""

            # 1.先对比前两个字符串是否存在公共前缀
            shorted_str = strs[1]  if len(strs[0]) > len(strs[1]) else strs[0]
            for i in range(0,len(shorted_str)):
                # 注意：这里要比较前缀，而不是比较里面有几个字符相等，也就是只要有不相等的字符，就直接停止
                if strs[0][i] == strs[1][i]:
                    common_prefix += strs[0][i]
                else:
                    break

            # 2.如果没有公共前缀
            if len(common_prefix) <= 0:
                return common_prefix

            # 3.如果存在公共前缀，我们就继续看有没有更短的公共的前缀

            for index in range(2,len(strs)):
                temp_str = ''
                pre_count = len(common_prefix)
                current_count = 0
                for prefix_index in range(0,len(common_prefix if len(common_prefix) <= len(strs[index]) else strs[index])):
                    if common_prefix[prefix_index] == strs[index][prefix_index]:
                        current_count+=1
                        temp_str += strs[index][prefix_index]

               # 如果对比完毕发现有个字符并没有对应的前缀就直接返回空字符
                if current_count == 0:
                    return ""
                # 比对完毕，比对长度，如果新的公共前缀，比之前的小，那么说明之前的前缀并不是全局的前缀
                elif pre_count > current_count:
                    common_prefix = temp_str


        return common_prefix





